void fixedifftstage::init(int Ninput)
{
    N = Ninput;

    memory = new FixedComplex<32> [N / 2];

    state = Fifft_STATE_INITIAL;

    read_pointer = 0;
    write_pointer = 0;

    ready = 1;

    clock = 0;

//	cout << "ifft bufferfly " << N << " was created" << endl;
}

fixedifftstage::fixedifftstage(int Ninput)
{
    init(Ninput);
}

